import './App.css';
import Header from './components/Header/Header.js'
import Footer from './components/Footer/Footer.js'
import Home from './pages/HomePage/HomePage.js'

function App() {
  return (
    <div className="App">
      <Header />
      <Router>
        <div>
          <Navigation />
          <Switch>
            <Route path="/" Home={Home} />
          </Switch>
        </div>
      </Router>
      <Footer />
    </div>
  );
}

export default App;
